import React from "react";
import { Button } from "antd";
const CustomButton = ({ title, showDrawer }) => {
  return (
    <div style={{ textAlign: "right" }}>
      <Button onClick={showDrawer}>{title}</Button>
    </div>
  );
};

export default CustomButton;
